import React from 'react'
import {withOktaAuth} from "@okta/okta-react";

const api_token = '00WhTQiM4FjUkWkH3oIza6jFaJjS9gGHf8HRgK2ReG'

export default withOktaAuth(class Admin extends React.Component{

    state = {
        users: null
    }


    componentDidMount() {
        this.fetchUsers()
    }

    fetchUsers = () => {
        const packet = {
            method: "GET",
            headers: {
                'Content-Type': "application/json",
                'Accept': "application/json",
            },
        }
        fetch("https://www.bengarlock.com:8080/oktausers/", packet)
            .then(res => res.json())
            .then(users => this.setState({users: users}))
    }

    renderUsers = () => {
        return this.state.users.map(user => <User key={user.id} user={user}/>)
    }





    render() {
        console.log(window.location.origin + '/login/callback',)
        return(
            <div>
                <h3>User Administration</h3>
                <table>
                    {this.renderUsers()}
                </table>
            </div>


        )
    }
})
